function TypeIcons(types) {
    console.log(types[0].type.name)
    let icons = [];
    switch(types[0].type.name){
        case "water": icons.push("https://img.icons8.com/color/48/000000/grass.png")
        break;
        case "fire":icons.push("https://img.icons8.com/color/48/000000/fire-element--v1.png")
        
    }
}
export default TypeIcons;
